    background: rgba(var(--secondary-color-code), 0.05);
    border-radius: 8px;
    transition: 0.3s;
  }

  &::after {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    z-index: -1;

    width: 100%;
    height: 100%;

